import React from "react";
import { Document} from "react-pdf";
import resume from "../images/Resume.pdf";

function Resume(){
    return(
     <div className="container my-3" >
        <iframe src={resume} style={{width: "300px",
        height: "auto" , 
        textAlign: "center", 
        marginLeft:"0",
        marginRight:"0"
        }}/>
     </div>
    );
}

export default Resume;
